import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

export default function ChatApp() {
    return(
        <View style={stylesChatBox.chatContainer}>
            <Text>Connected: {connected}</Text>
            <Text>Ping Connected: {pingData}</Text>
        </View>
    )
}

const stylesChatBox = StyleSheet.create({
    chatContainer: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center'
    }
});
